import { Card, Avatar, Button, Col, Row, Descriptions } from "antd";
import CenteralAppLayout from "./CenteralAppLayout";
import NavibarLayout from "./NavibarLayout";
const ProfileCard = () => {
  const dummy = {
    pet: {
      name: "wilson",
      breed: "골든 리트리버",
      birth: 2,
      address: "경기도 성남시 분당구",
      image: "http://www.animaltogether.com/news/photo/201907/167_346_855.jpg",
    },
    owner: { name: "kk" },
  };
  return (
    <CenteralAppLayout>
      <NavibarLayout>
        <Card title={dummy.pet.name} actions={[]} cover={<img src={dummy.pet.image} />}>
          <Card.Meta
            title={dummy.owner.name}
            avatar={<Avatar src={dummy.pet.image} />}
            description={
              <Descriptions bordered>
                <Descriptions.Item label={"견종"} span={24}>
                  {dummy.pet.breed}
                </Descriptions.Item>
                <Descriptions.Item label={"나이"} span={24}>
                  {dummy.pet.birth}
                </Descriptions.Item>
                <Descriptions.Item label={"주소"} span={24}>
                  {dummy.pet.address}
                </Descriptions.Item>
              </Descriptions>
            }
          />
        </Card>
      </NavibarLayout>
    </CenteralAppLayout>
  );
};

export default ProfileCard;
